using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct DamageComponentResolver : IResolver<DamageComponent>, IResolver<DamageComponentResolver,DamageComponent>, IData	{		public DamageComponentResolver In(ref DamageComponent damagecomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<DamageComponent>();			Out(ref local);		}		public void Out(ref DamageComponent damagecomponent)		{		}	}}